import React from "react";
import {
    WriterWrapper,
    WriterTitle,
    WriterChange,
    Author
} from "../home_style"; 

class Writer extends React.Component{
    render(){
        return (
            <WriterWrapper>
                <WriterTitle>
                    推荐作者
                    <WriterChange>换一批</WriterChange>
                </WriterTitle>
                <Author>
                    <img className="author-img" src="https://upload.jianshu.io/users/upload_avatars/4790772/388e473c-fe2f-40e0-9301-e357ae8f1b41.jpeg?imageMogr2/auto-orient/strip|imageView2/1/w/96/h/96/format/webp"></img>
                    
                    <p className="author-name">Ivan Liang</p>
                </Author>
            </WriterWrapper>
        )
    }
}
export default Writer;
